// src/components/Header.js
import React from 'react';
import '../styles/Header.scss'; // Assure-toi d'avoir ce fichier de styles

const Header = () => {
  return (
    <header className="header">
      <div className="header-content">
        <div className="header-description">
          <h1>Bienvenue sur mon Portfolio</h1>
          <p>Je suis <strong>Calvet-Cluzel Axel</strong>, Développeur front-end passionné par la création d'interfaces utilisateur modernes et intuitives. J'ai une expérience dans le développement avec React, JavaScript, HTML, CSS, et SCSS.</p>
        </div>
        <div className="profile-bubble">
          {/* La photo de profil pourra être ajoutée ici */}
        </div>
      </div>
    </header>
  );
}

export default Header;
